INSERT INTO `borsApp_oferta` VALUES (1,'2019-09-05 21:31:15.000000','2019-10-28 21:32:09.000000',1,'Oferta laboral DISSENYADOR/A d\'Apps m√≤bils','<p>Som <span class=\"il\">Abalit</span> Technologies, la companyia l&iacute;der en desenvolupament d\'Apps a Barcelona i en cont&iacute;nua expansi&oacute; a Madrid, New York i Londres. En els &uacute;ltims 6 anys, hem desenvolupat prop de 300 apps arreu del m&oacute;n. A m&eacute;s a m&eacute;s, col&middot;laborem amb entitats sense &agrave;nim de lucre i \"non profits\" amb projectes socials on desenvolupem apps que milloren el dia a dia dels col&middot;lectius en risc d\'exclusi&oacute;.</p>\r\n<p>Actualment ens trobem a la fase final de selecci&oacute; <strong>d\'un/a dissenyador/a gr&agrave;fic/a d\'apps m&ograve;bils</strong>, i voldriem comptar amb la candidatura <strong>d\'alumnes vostres que hagin acabat (o n\'estiguin apunt) el curs</strong>.</p>\r\n<p>Us adjuntem l\'oferta en text i imatge perqu&egrave; en pogueu fer la difusi&oacute; que cregueu oportuna.</p>\r\n<p><strong>No &eacute;s necessari tenir experi&egrave;ncia</strong> per&ograve; s&iacute; que ens envi&iuml;n alguna maqueta de disseny que hagin preparat ells (encara que sigui nom&eacute;s per a accedir a l\'entrevista).</p>\r\n<p>La incorporaci&oacute; &eacute;s inmediata, inmillorable entorn de treball jove, salari de mercat amb alts incentius de producci&oacute;, horari laboral amb els divendres tarda \"festa\" i molts altres avantatges m&eacute;s</p>\r\n<p>Gr&agrave;cies!</p>',1,1),(2,'2019-09-05 21:39:27.000000','2019-09-30 21:39:35.000000',1,'Selecci√≥ de programadors PHP/MYSQL/SYMFONY a BARCELONA','<p>Actualment ens trobem en cerca activa d\'un programador PHP/MYSQL/SYMFONY, els passem l\'oferta a continuaci&oacute;.</p>\r\n<p>Els agra&Iuml;riem que ho envi&eacute;ssin a la seva cartera d\'alumnes o exalumnes que tinguin inter&egrave;s en treballar a unes de les empreses tecnol&ograve;giques punteres de Barcelona, amb una gran perspectiva d\'aprenentatge i creixement.</p>\r\n<p>&nbsp;</p>\r\n<p>Gr&agrave;cies!</p>\r\n<p>&nbsp;</p>\r\n<p><strong>--OFERTA LABORAL <span class=\"il\">ABALIT</span>--</strong></p>\r\n<p>A <span class=\"il\">Abalit</span> Technologies, la companyia l&iacute;der en desenvolupament d\'Apps a Barcelona i en cont&iacute;nua expansi&oacute; a Madrid, New York i Londres, en els &uacute;ltims 6 anys, hem desenvolupat prop de 300 apps arreu del m&oacute;n. A m&eacute;s a m&eacute;s, col&middot;laborem amb entitats sense &agrave;nim de lucre i \"non profits\" amb projectes socials on desenvolupem apps que milloren el dia a dia dels col&middot;lectius en risc d\'exclusi&oacute;.<br /> <br /> Actualment ens trobem a la fase final de selecci&oacute; d\'un/a programador/a PHP+MySQL+SYMFONY al centre de Barcelona (Urgell/Arag&oacute;) amb excel&middot;lent connexi&oacute; al transport p&uacute;blic i RENFE.<br /> <br /> Entorn de treball jove i din&agrave;mic (som prop de 20 persones a l\'equip), amb el \"bon rollo\" que va associat a la nostra mentalitat emprenedora. Grans perspectives i oportunitats de creixement professional dins de la nostra companyia, amb formaci&oacute; continuada i gran pack d\'avantatges exclusius.<br /> <br /> El salari es de 16.000 a 24.000&euro;, a concretar segons el valor que aporti el/la candidat/a, amb una part variable d\'incentius de producci&oacute; molt elevats. Jornada de 40h/setmana amb els divendres a la tarda festa, o b&eacute; mitja jornada.<br /> <br /> L\'&uacute;nic requisit que demanem &eacute;s que no facis feines de programador fora de la nostra empresa.<br /> <br /> Incorporaci&oacute; immediata.<br /> <br /> No t\'ho pensis m&eacute;s, envia\'ns el teu CV actualitzat a <a class=\"m_236945922591293889moz-txt-link-abbreviated\" href=\"mailto:rrhh@abalit.org\" target=\"_blank\">rrhh@<span class=\"il\">abalit</span>.org</a> i un resum de m&agrave;xim 50 paraules amb la teva experi&egrave;ncia o coneixements en PHP + MYSQL + SYMFONY.</p>',1,1),(3,'2019-09-19 09:44:14.000000','2019-09-20 06:00:00.000000',1,'mlav','<p>svld</p>',23,2),(4,'2019-09-24 09:38:19.000000','2019-09-30 09:38:40.000000',1,'Mecatr√≥nic aeron√†utic','<p>lloc de treball a la NASA (USA)</p>',6,3);
